// const initialState = []

const initialState = {
  firstname: "",
  lastname: "",
  title: "",
  email: "",
  password: "",
}

export default (state = initialState, action) => {
  switch (action.type) {
    case "INDEX_ORGANIZATIONS":
      return action.organizations
    default:
      return state
  }
}
